INSERT INTO pcornet_vital VALUES (3, '\PCORI\VITAL\TOBACCO\SMOKING\', 'Smoked Tobacco Status', 'N', 'CA ', NULL, NULL, NULL, 'concept_cd', 'CONCEPT_DIMENSION', 'concept_path', 'T', 'like', '\PCORI\VITAL\TOBACCO\SMOKING\', 'CDMv2', 'This field is new to v3.0. Indicator for any form of tobacco that is smoked.Per Meaningful Use guidance, smoking status includes any form of tobacco that is smoked, but not all tobacco use. "Light smoker" is interpreted to mean less than 10 cigarettes per day, or an equivalent (but less concretely defined) quantity of cigar or pipe smoke. "Heavy smoker" is interpreted to mean greater than 10 cigarettes per day or an equivalent (but less concretely defined) quantity of cigar or pipe smoke.', '@', '2015-08-17 15:53:15', '2015-08-17 15:53:15', '2015-08-17 15:53:15', 'PCORNET_CDM', NULL, NULL, '\PCORI\VITAL\TOBACCO\', 'SMOKING', NULL);
INSERT INTO pcornet_vital VALUES (3, '\PCORI\VITAL\TOBACCO\02\', 'Non-Smoked Tobacco Status', 'N', 'CA ', NULL, NULL, NULL, 'concept_cd', 'CONCEPT_DIMENSION', 'concept_path', 'T', 'like', '\PCORI\VITAL\TOBACCO\02\', 'CDMv2', 'In SCILHS, this field is for NON-SMOKED tobacco ONLY. The PCORnet spec uses this for any form of tobacco. This field is new to v2.0 with revised value set and field definition in v3.0.', '@', '2015-08-17 15:53:15', '2015-08-17 15:53:15', '2015-08-17 15:53:15', 'PCORNET_CDM', NULL, NULL, '\PCORI\VITAL\TOBACCO\', '02', NULL);
